import React from 'react';
import './App.css';

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.myRef = React.createRef();
  }

  render() {
    return (
      <div className="App" onKeyPress={this.myRef.current.focus()}>
        <div className="App-header">

        </div>
        <div ref={this.myRef} className="App-header2">
          <p>Hello</p>
        </div>
      </div>
    );
  }
}
